import { BrandsStateActionTypes } from "../../types/brand"

export const addBrandsAction = () => {
    const payload = fetch('../../files/brands.json')
        .then( (res) => {
            res.json
        }

            // console.log(response)
        )


    return {type: BrandsStateActionTypes.ADD_BRANDS, payload}
}
